import { Col, Row } from "antd";
import Search from "antd/lib/transfer/search";
import React from "react";
function main_search() {
  return (
    <>
      <Row>
        <Col>
          <Search placeholder="Zip, City, Neighboor" />
        </Col>
      </Row>
    </>
  );
}

export default main_search;
